import React from "react";
import { useEffect } from "react";

function SongList ({songs}) {

  useEffect(() => {
    console.log('Data updated'); console.log('-------------');
  }, [songs]);


  return (
    <div className="main">
      <div className="songList">
        <h2>Results</h2>
        <ul>

          {songs.map(song => (
            <li key={song.id}>{song.name}</li>
          ))}
        </ul>
      </div> 
      <div className="songList">
        <h2>Playlist</h2>
      </div>
    </div>
  )
}

export default SongList;
